

class scanner:


    def idtoken(token):
        if token == '`':
            return 0
        elif token == '<':
            return 1
        elif token == '>':
            return 2
        elif token == '[':
            return 3
        elif token == ']':
            return 4
        elif token == '{':
            return 5
        elif token == '}':
            return 6
        elif token == '@':
            return 7
        elif token == '&':
            return 8
        elif token == '#':
            return 9
        elif token == '!':
            return 10
        elif token == '~':
            return 11
        elif token == "'":
            return 12
        elif token == '"':
            return 13
        elif token == '$':
            return 14
        elif token == ':':
            return 15
        elif token == ';':
            return 16
        elif token == '.':
            return 17
        elif token == ',':
            return 18
        elif token == '+':
            return 19
        elif token == '-':
            return 20
        elif token.isdigit():
            return 21
        elif token == '/':
            return 22
        elif token == '\\':
            return 23
        elif token == '*':
            return 24
        elif token == '=':
            return 25
        elif token == '^':
            return 26
        elif token == '(':
            return 27
        elif token == ')':
            return 28
        elif token.isalpha():
            return 29
        elif token == ' ':
            return 30
        elif token == '_':
            return 31    


        elif token == '\n':
            return 32
        return 33


