    def scan(filename):

        f = open(filename, "r")

        file_contents = f.read()


        rwords = []
        with open('rwords.txt') as file:
            for line in file:
                rwords.append(line.replace('\n', ''))


        i = 0
        current_token = ""
        f = open("log.txt", "a")
        f.truncate(0)
        dicovered_token = ""
        accept = False
        current_state = 0

        tokens_found = []
        token_values = []

        while i < len(file_contents):

            token_identified = scanner.idtoken(file_contents[i])
            #print(current_token + " + " + file_contents[i])
            #print(action_table[current_state][token_identified])
            if(scanner.action_table[current_state][token_identified] == 0):
                    accept = False
                    current_token = ""
                    current_state = 0
            else:
                
                if(scanner.state_table[current_state][token_identified] != -1):
                    current_state = scanner.state_table[current_state][token_identified]
                    current_token += file_contents[i]


                elif(scanner.action_table[current_state][token_identified] == 2):
                        accept = True
                else:
                    current_token += file_contents[i]


                if(accept == True):

                    dicovered_token = scanner.token_values[scanner.lookup_table[current_state][token_identified]]
                    for rword in rwords:
                        if(current_token == rword.strip()):
                            dicovered_token = "reservedword"
                            accept = True
                    if(dicovered_token != 'whitespace'):
                        tokens_found.append(dicovered_token)
                        token_values.append(current_token)
                        f.write("Token Discovered is " + dicovered_token + " -> " + current_token + '\n')
                    accept = False
                    current_token = ""
                    current_state = 0
                    i -= 1
            i += 1
        f.close()

        return tokens_found, token_values



